commits.content:
.navbar {
  display: flex;
  justify-content: space-between;
  align-items: center;
  padding: 18px 50px;
  background-color: #fff;
  border-bottom: 1px solid #eaeaea;
  font-family: Arial, sans-serif;
}

.logo {
  font-size: 22px;
  font-weight: 700;
  color: #000;
}

.nav-center {
  list-style: none;
  display: flex;
  gap: 30px;
}

.nav-center li a {
  text-decoration: none;
  color: #333;
  font-weight: 500;
  font-size: 16px;
}

.nav-center li a:hover {
  color: #ff6600;
}

.account-link {
  text-decoration: none;
  color: #333;
  font-weight: 500;
  font-size: 16px;
}

.account-link:hover {
  color: #ff6600;
}
